import React from 'react';
import GoogleLogin from 'react-google-login'
import {gapi} from 'gapi-client'

const Login = () => {
    gapi.load('client:auth2', start)

    function start() {
        console.log('a')
        gapi.client.init({
            clientId: "1010983540888-f1sblt8aj006tvabkas65plkmqjaditt.apps.googleusercontent.com",
            scope: ""
        })
    }
    const handleFailure = (result) => {
        localStorage.setItem("google_account", JSON.stringify(result))
    }
    const handleLogin = (googleData) => {        
        localStorage.setItem("google_account", JSON.stringify(googleData))
    }
    return (

        <GoogleLogin
            clientId="1010983540888-f1sblt8aj006tvabkas65plkmqjaditt.apps.googleusercontent.com"
            buttonText='Log in with Google'
            onSuccess={handleLogin}
            onFailure={handleFailure}
            cookiePolicy={'single_host_origin'}
            isSignedIn={true}
        >

        </GoogleLogin>

    );
}

export default Login;
